A set of bedding usually consists of a flat or fitted sheet which covers the mattress; a flat top sheet; either a blanket, quilt, or duvet with a duvet cover which can replace; and a number of pillows with pillowcases.

Perfect Décor offers a fantastic range of modern and traditional top quality made-to-measure curtains, blinds, bedding and accessories. With our selection, you’re guaranteed to find something that works perfectly for every bedroom in your home.

&nbsp;

Motorized blinds and shades offer you the ultimate in simplicity, safety and style. You can control multiple window coverings with a simple touch of a button and/or timer. Motorized blinds and shades are ideal for homes with children or pets; a safer alternative to accessible cords. The smooth, quiet operation is perfect for family rooms, home theaters and bedrooms.

